import React from 'react';
import './RecValue.css';


const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <table>
                <thead key={item.id}>
                    <th key={item.id}>Ingredients</th>
                </thead>
            <tbody id="content">
            <tr> 
            <td>{item.name}</td>
            <td>{item.value} </td>
            </tr>
            </tbody>
        </table>
            )
    }
        return (
            
            <div>
            {renderData()}
            </div>
            
        )
    }


export default RecValue;
